sys_variable_value.value:
(function execute(inputs, outputs) {
	function abortAndLog(type, message) {
		type === 'error' ? gs.error(message) : gs.info(message);

		outputs['new_aes_users'] = null;
		outputs['dev_url'] = null;
		outputs['should_abort'] = true;
    }

	var lastProcessedGR = new GlideRecord(SyncConstants.LAST_PROCESSED_TABLE);
	lastProcessedGR.query();

	var lastProcessedDictionary = {};

	while (lastProcessedGR.next()) {
		lastProcessedDictionary[lastProcessedGR.getValue('name')] = lastProcessedGR.getValue('last_processed');
    }

	try {
        var pipelineService = new PipelineService();
        var aesUtils = new AesUtils();
        var devEnvUrl = pipelineService.getEnvironmentUrl(PipelineConstants.DEV_ENV_COLUMN);
        var SYS_USER_TABLE = 'sys_user';
		var syncUserInformationRequest = pipelineService.buildRequest(
          'POST',
          PipelineConstants.DEV_ENV_COLUMN,
          '/api/sn_app_eng_studio/generic/new_aes_users',
          { requestBody: { lastProcessedDictionary: lastProcessedDictionary } }
        );
		var response = syncUserInformationRequest.execute();
    }
	catch (e) {
	    abortAndLog('info', e.toString());

		return;
    }

  	var status = response.getStatusCode();

  	if (status !== 200) {
	    abortAndLog('error', response.getErrorMessage());

		return;
    }

	var body = JSON.parse(response.getBody());

    if (!body || body.result && body.result.sysUsers && body.result.sysUsers.length === 0) {
		abortAndLog('info', 'No new users with AES access have been found.');

		return;
    }

	var usersWithAESRole = body.result.sysUsers;
	var newAesUsers = [];

	usersWithAESRole.forEach( function (user) {
		if(!!user.email) { newAesUsers.push(user) }
    });

    var usersMissingEmail = usersWithAESRole.filter(function (user) { return !user.email; });
    var usersMissingEmailDictionary = aesUtils.groupBy(usersMissingEmail, 'sys_id');
	var sysUserGR = new GlideRecord(SYS_USER_TABLE);

	sysUserGR.addQuery('sys_id', usersMissingEmail.map(function(user) { return user.sys_id }));
	sysUserGR.addNotNullQuery('email');
    sysUserGR.query();

    while (sysUserGR.next()) {
		var devUser = usersMissingEmailDictionary[sysUserGR.getValue('sys_id')][0];
		var emailFromProd = sysUserGR.getValue('email');

		newAesUsers.push({
			email: emailFromProd,
			first_name: devUser.first_name,
			password_needs_reset: devUser.password_needs_reset,
			sys_id: devUser.sys_id,
		});
    }

	// If there is only one user, and that user does not have an e-mail address, we never set
    // user properties and push to newAesUsers. When that happens, the flow will return an array
    // with one object and it's properties set all to null.
	if (newAesUsers.length === 0) {
	    abortAndLog('info', 'No new users with AES access have been found.');

		return;
    }

	outputs['should_abort'] = false;
	outputs['new_aes_users'] = newAesUsers;
	outputs['dev_url'] = devEnvUrl;
})(inputs, outputs);

